import User from './components/user';
import LoginForm from './components/form';

function App() {
  return (
    <div className="App">
        <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code><HelloWorld /></code>
        </p>
        </header>
    </div>
  );
}

export default App;
